    /**
     * 单文件解析
     *
     * @param ref 写入数据路径
     * @param list 数据文件路径
     * @throws Exception
     */
    public static void run01(String ref, List<File> list) throws Exception {
        try (BufferedWriter br = new BufferedWriter(new FileWriter(new File(ref)))) {
            list.forEach(f -> {
                try {
                    String fn = f.getName();
                    String content = "";
                    byte[] bytes = Files.readAllBytes(f.toPath());
                    if (new String(Arrays.copyOfRange(bytes, 0, 12), "UTF-8").startsWith("{")) {
                        content = new String(bytes, "UTF-8");
                    } else {
                        content = BrotliUtils.decompressor(bytes).toString(SerializerFeature.WriteMapNullValue);
                    }
                    br.write(fn);
                    br.newLine();
                    br.write(content);
                    br.newLine();
                } catch (Exception e) {
                    e.printStackTrace();
                }
            });
        }
    }

    /**
     * 整合Zip解析文件
     *
     * @param ref 写入数据路径
     * @param zip 数据文件路径
     * @throws Exception
     */
    public static void run02(String ref, String zip) throws Exception {
        ZipFile zipFile = BrotliUtils.getZipFile(zip);
        List<String> entryList = BrotliUtils.entryList(zip).stream().sorted().collect(Collectors.toList());
        try (BufferedWriter br = new BufferedWriter(new FileWriter(new File(ref)))) {
            int len = -1;
            byte[] buff = new byte[1024];
            for (String entry : entryList) {
                try (InputStream inputStream = BrotliUtils.getResource(zipFile, entry);
                     ByteArrayOutputStream baos = new ByteArrayOutputStream()) {
                    while ((len = inputStream.read(buff, 0, buff.length)) != -1) {
                        baos.write(buff, 0, len);
                    }
                    byte[] bytes = baos.toByteArray();
                    if (bytes.length == 0)
                        continue;
                    String content = BrotliUtils.decompressor(bytes).toString(SerializerFeature.WriteMapNullValue);
                    br.write(entry);
                    br.newLine();
                    br.write(content);
                    br.newLine();
                } catch (Exception e) {
                    e.printStackTrace();
                }
            }
        }
    }

